class Solution:
    def isSubsequence(self, s, t):
        """
        Given a string s and a string t, check if s is subsequence of t. 
        :type s: str
        :type t: str
        :rtype: bool
        """
        def helper(i,j):
            if i == -1:
                return True
            if j == -1:
                return False

            pipei = False
            if s[i] == t[j]:
                pipei = helper(i-1, j-1)

            new_j = t.rfind(s[i],0,j)
            return pipei or helper(i, new_j)

        return helper(len(s)-1,len(t)-1)

s="pppsppuppppbsppppppppppppppppppppepppppppppppqpupppepppppppppppppppnpppppppcppppppppppppeppppppppppp"
t=""
